css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("www.rememberthemilk.com") {
body {
	color: #111 !important;
}

/* links */

a:link { color:#DD3030 !important; }
a:visited { color:#B30000 !important; }
a:active { color:#FF8080 !important; }
a:hover { color:#000000 !important; }


#appheaderlogo {
	background: transparent url(data:image/png;base64,) repeat scroll 0% !important;
}


/* search box */

#searchboxwrap table {
	border-color: #FF8080 !important;
}

#searchicon {
	background:transparent url(data:image/png;base64,) no-repeat scroll 4px !important;
}


.taskaddicon {
background-image: url(data:image/gif;base64,R0lGODlhDwAPALMAAP/////5+f/m9f/h8P/U6//H5v+s3P+f1/+V0/94yf93yP9rw/9kwf9gv////wAAACH5BAEHAA4ALAAAAAAPAA8AAARK0Mk5xrxUtb0LdgcnNspliEkiltIIAKOHuPDoMHiavDrncK9gUNUYcATIF1Kw2Ayaoteo4ThFaxwWbWRxEKaiw+ULNnyq0AYCEwEAOw==);
	
}


div.navtabs a { 
	background: url(data:image/png;base64,) 0px -300px no-repeat !important;
}


div.navtabs a span { 
	background: url(data:image/png;base64,)  100% -300px no-repeat !important;
}


.xtabs {
	background:#FFFFFF url(data:image/gif;base64,R0lGODlhFAAtAJEAAP/MzP///////wAAACH5BAEHAAIALAAAAAAUAC0AAAIglI+py+0Po5y02ouz3rz7D4biSJbmiabqyrYXAMfyPBcAOw==) repeat-x scroll center bottom !important;
}
.xtabs li {
	background:transparent url(data:image/png;base64,) no-repeat scroll left top !important;
	border-bottom:1px solid #FFBEBE !important;
}
.xtabs .xtab_smartlist {
	background:transparent url(data:image/png;base64,) no-repeat scroll left top !important;
}
.xtabs_grey li {
	background:transparent url(data:image/png;base64,) no-repeat scroll left top !important;
}
.xtabs a {
	background:transparent url(data:image/png;base64,) no-repeat scroll right top !important;
	color:#FFFFFF !important;
}
.xtabs .xtab_smartlist a {
	background:transparent url(data:image/png;base64,) no-repeat scroll right top !important;
}
.xtabs_grey a {
	background:transparent url(data:image/png;base64,) no-repeat scroll right top !important;
}



}
